import React from "react";

const VideoPlayer = ({ trailerLink, status }) => {
  return (
    <div className="videoPlayer">
      <div className="videoMsg">
        {!status ? "Trailer not available" : "Trailer available"}
      </div>
      <div className={status ? "YTO" : "YTC"}>
        <iframe title="video" src={trailerLink}></iframe>
      </div>
    </div>
  );
};

export default VideoPlayer;
